import React from "react";
import { Component } from "react";
import { DashboardWrap } from "../styles/routes/DashboardStyle";

class Dashboard extends Component {
  render() {
    return (
      <DashboardWrap>
        <div className="navbar"></div>
        <div></div>
      </DashboardWrap>
    );
  }
}

export default Dashboard;
